-- Drivers Table
CREATE TABLE IF NOT EXISTS drivers (
  id VARCHAR(255) PRIMARY KEY,
  driverName VARCHAR(255),
  driverNumber VARCHAR(255),
  phone VARCHAR(255),
  hourlyRate DECIMAL(10, 2),
  overtimeRate DECIMAL(10, 2),
  currency VARCHAR(10),
  assignedMonths TEXT,
  createdAt TIMESTAMP,
  createdBy VARCHAR(255)
);


-- Employees Table
CREATE TABLE IF NOT EXISTS employees (
  id VARCHAR(255) PRIMARY KEY,
  employeeName VARCHAR(255),
  employeeNumber VARCHAR(255),
  salary DECIMAL(10, 2),
  currency VARCHAR(10),
  paymentDate DATE,
  isPaid BOOLEAN,
  assignedMonths TEXT,
  createdAt TIMESTAMP,
  createdBy VARCHAR(255)
);


-- Expense Types Table
CREATE TABLE IF NOT EXISTS expenseTypes (
  id VARCHAR(255) PRIMARY KEY,
  typeName VARCHAR(255),
  color VARCHAR(50),
  createdAt TIMESTAMP,
  createdBy VARCHAR(255)
);


-- App Settings Table
CREATE TABLE IF NOT EXISTS app_settings (
  id VARCHAR(255) PRIMARY KEY,
  settingKey VARCHAR(255),
  settingValue TEXT,
  settingCategory VARCHAR(100),
  description TEXT,
  createdAt TIMESTAMP,
  createdBy VARCHAR(255)
);


-- Print Templates Table
CREATE TABLE IF NOT EXISTS print_templates (
  id VARCHAR(255) PRIMARY KEY,
  templateName VARCHAR(255),
  templateType VARCHAR(100),
  html_content TEXT,
  css_content TEXT,
  isDefault BOOLEAN,
  description TEXT,
  createdAt TIMESTAMP,
  createdBy VARCHAR(255)
);

