-- Expenses Table
CREATE TABLE IF NOT EXISTS expenses (
  id VARCHAR(255) PRIMARY KEY,
  expenseDate DATE,
  driverId VARCHAR(255),
  driverName VARCHAR(255),
  driverNumber VARCHAR(255),
  expenseType VARCHAR(255),
  hours DECIMAL(10, 2),
  hourlyRate DECIMAL(10, 2),
  isOvertime BOOLEAN,
  amount DECIMAL(10, 2),
  currency VARCHAR(10),
  isPaid BOOLEAN,
  isDeleted BOOLEAN,
  description TEXT,
  createdAt TIMESTAMP,
  createdBy VARCHAR(255)
);

